import React from 'react';
import './App.css';
import Header from './components/Header';
import Nav from './components/Nav';
import Drinks from './components/Drinks';

function App() {
  return (
    <div className="app">
      <Header />

      <Nav />

      <Drinks />
    </div>
  );
}

export default App;
